-- UPS only test - Has a lot of short loco's going through medium sized tunnels at once.

local Test = {}
local TestFunctions = require("scripts.test-functions")

Test.RunTime = nil

Test.OnLoad = function()
end

---@param testName string
Test.Start = function(testName)
    local blueprintString = ""

    local count = 100
    for i = 0 - (count / 2), (count / 2) do
        local yPos = i * 8
        TestFunctions.BuildBlueprintFromString(blueprintString, {x = 0, y = yPos}, testName)
    end
end

Test.Stop = function()
end

return Test
